DROP TABLE IF EXISTS `client_group`;
CREATE TABLE `client_group` (
  `client_id` int(11) NOT NULL AUTO_INCREMENT,
  `client_name` varchar(50) NOT NULL COMMENT '客户端名称',
  `platform` enum('Ruby','Node','Python','NET','php','java') NOT NULL COMMENT '客户端平台 ',
  `master` bit(1) NOT NULL DEFAULT b'0' COMMENT '是否主分支 1 是 0 否， 每个平台限定唯一的主分支',
  `describes` varchar(255) DEFAULT NULL COMMENT '描述 说明',
  `create_time` datetime NOT NULL COMMENT '创建时间',
  `last_update_time` timestamp NOT NULL DEFAULT '0000-00-00 00:00:00' ON UPDATE CURRENT_TIMESTAMP COMMENT '最后修改时间',
  `disable` bit(1) NOT NULL COMMENT '记录是否有效 1 有效 0逻辑删除',
  PRIMARY KEY (`client_id`),
  UNIQUE KEY `client_name` (`client_name`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=2 DEFAULT CHARSET=utf8 COMMENT='客户端分组';

